import React from "react";
import { Tabs } from "antd";

export default function Story() {
  return (
    <div>
      <Tabs
        defaultActiveKey="1"
        centered
        items={new Array(3).fill(null).map((_, i) => {
          const id = String(i + 1);
          return {
            label: `Tab ${id}`,
            key: id,
            children: `Content of Tab Pane ${id}`,
          };
        })}
        addIcon
      />
    </div>
  );
}
